import React, { useState, useEffect } from 'react';
import { Container, Box, Typography, Grid, Card, Button, CircularProgress } from '@mui/material';
import { getAccountData, getSummonerData, getMatchHistoryWithWinRate, getVersion } from './services/api';
import SummonerForm from './components/SummonerForm';
import SummonerProfile from './components/SummonerProfile';
import MatchList from './components/MatchList';

function App() {
  const [summoner, setSummoner] = useState(null);
  const [matches, setMatches] = useState([]);
  const [version, setVersion] = useState('');
  const [wins, setWins] = useState(0);
  const [losses, setLosses] = useState(0);
  const [winRate, setWinRate] = useState(0);

  const [limit] = useState(10);  // Number of matches to load per request
  const [offset, setOffset] = useState(0);
  const [loading, setLoading] = useState(false);
  const [allMatchesLoaded, setAllMatchesLoaded] = useState(false);

  useEffect(() => {
    const fetchVersion = async () => {
      const versionData = await getVersion();
      if (versionData) {
        setVersion(versionData.version);
      }
    };
    fetchVersion();
  }, []);

  const handleAccountDataFetched = async (data) => {
    const { puuid, gameName, tagLine } = data;
    const summonerData = await getSummonerData(puuid);
    setSummoner({ ...data, ...summonerData });

    setMatches([]);  // Clear previous matches
    setOffset(0);  // Reset offset for pagination
    setAllMatchesLoaded(false);  // Reset load more status
    loadMoreMatches(puuid, true);  // Load initial matches
  };

  const loadMoreMatches = async (puuid, isInitialLoad = false) => {
    if (loading || allMatchesLoaded) return;

    setLoading(true);

    const matchHistoryData = await getMatchHistoryWithWinRate(puuid, limit, offset);
    if (matchHistoryData.error) {
      setLoading(false);
      return;
    }

    if (isInitialLoad) {
      setWins(matchHistoryData.wins);
      setLosses(matchHistoryData.losses);
      setWinRate(matchHistoryData.winRate);
    }

    setMatches((prevMatches) => [...prevMatches, ...matchHistoryData.matchDetails]);
    setOffset((prevOffset) => prevOffset + limit);
    setAllMatchesLoaded(matchHistoryData.fetchedMatches < limit);  // Stop if fewer matches returned than limit
    setLoading(false);
  };

  return (
    <Box sx={{ bgcolor: '#1a1c23', minHeight: '100vh', display: 'flex', flexDirection: 'column' }}>
      <Container
        maxWidth="md"
        sx={{
          color: '#f0f0f0',
          flex: 1,
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          py: 3,
        }}
      >
        <Box sx={{ textAlign: 'center', mb: 4 }}>
          <Typography
            variant="h4"
            component="h1"
            sx={{
              fontWeight: 'bold',
              color: '#f0f0f0',
              bgcolor: '#1f2937',
              p: 2,
              borderRadius: 2,
            }}
          >
            My League Stats
          </Typography>
        </Box>
        <Grid container spacing={4} sx={{ width: '100%' }}>
          <Grid item xs={12}>
            <Card sx={{ p: 3, bgcolor: '#2d3748', color: '#f0f0f0', boxShadow: 5, borderRadius: 3 }}>
              <SummonerForm onAccountDataFetched={handleAccountDataFetched} />
            </Card>
          </Grid>
          {summoner && (
            <Grid item xs={12}>
              <SummonerProfile summoner={summoner} wins={wins} losses={losses} winRate={winRate} />
            </Grid>
          )}
          <Grid item xs={12}>
            <Card sx={{ p: 3, bgcolor: '#1f2937', color: '#f0f0f0', boxShadow: 5, borderRadius: 3 }}>
              <MatchList matches={matches} />
              {!allMatchesLoaded && (
                <Box display="flex" justifyContent="center" mt={2}>
                  <Button
                    variant="contained"
                    color="primary"
                    onClick={() => loadMoreMatches(summoner.puuid)}
                    disabled={loading}
                  >
                    {loading ? <CircularProgress size={24} color="inherit" /> : 'Load More Matches'}
                  </Button>
                </Box>
              )}
            </Card>
          </Grid>
        </Grid>
      </Container>
    </Box>
  );
}

export default App;
